// Concerns.js

import React from 'react';
import Header from './Header'; // Assuming Header.js is in the same folder
import './Concerns.css'; // Assuming you have a Concerns.css file for styling

const Concerns = ({ navigateTo }) => {
  return (
    <div>
      <Header navigateTo={navigateTo} />
      <div className="concerns-page">
        <h2>Shop by Concerns</h2>
        <div className="concerns-list">
          <p>Click on a concern to explore related products:</p>
          <ul>
            <li>
              <a href="#bleached-hair" onClick={() => navigateTo('bleached-hair')}>Bleached Hair</a>
            </li>
            <li>
              <a href="#curly-hair" onClick={() => navigateTo('curly-hair')}>Curly Hair</a>
            </li>
            <li>
              <a href="#damaged-hair" onClick={() => navigateTo('damaged-hair')}>Damaged Hair</a>
            </li>
            {/* Add more concerns as needed */}
          </ul>
        </div>
      </div>
    </div>
  );
};

export default Concerns;
